import React from 'react';
import './Leaderboard.css';

function Leaderboard({ leaderboardData }) {
    return (
        <div className="leaderboard">
            <h2>Leaderboard</h2>
            <ul>
                {leaderboardData.map((entry, index) => (
                    <li key={index}>
                        <div className="leaderboard-entry-details">
                            <div className="leaderboard-entry-logo">Logo</div>
                            <span className="leaderboard-entry-name">{entry.name}</span>
                            <span className="leaderboard-entry-name">{entry.comment} </span>
                            <span className="leaderboard-entry-amount">{entry.amount} Trees</span>
                            
                        </div>
                    </li>
                ))} 
            </ul>
        </div>
    );
}

export default Leaderboard;
